import numpy as np

def submatrix_with_n_numbers(matrix):
    count = 0
    rows, cols = matrix.shape
    for r in range(rows):
        for c in range(cols):
            for row in range(r, rows):
                for col in range(c, cols):
                    if (row-r+1)*(col-c+1) == 146:
                        count += 1
    return count
```

This function iterates over all possible submatrices in the matrix and increments a count whenever their size is equal to 146. Note, however, that this function will be quite slow for large input matrices because its time complexity is proportional to the cube of the number of rows and columns in the input matrix.
